_62:"precision mediump float;\n#define LOWPREC lowp\n// Uniforms look like they're shared between vertex and fragment shaders in GLSL, so we have to be careful to avoid name clashes\n\nuniform sampler2D gm_BaseTexture;\n\nuniform bool gm_PS_FogEnabled;\nuniform vec4 gm_FogColour;\nuniform bool gm_AlphaTestEnabled;\nuniform float gm_AlphaRefValue;\n\nvoid DoAlphaTest(vec4 SrcColour)\n{\n	if (gm_AlphaTestEnabled)\n	{\n		if (SrcColour.a <= gm_AlphaRefValue)\n		{\n			discard;\n		}\n	}\n}\n\nvoid DoFog(inout vec4 SrcColour, float fogval)\n{\n	if (gm_PS_FogEnabled)\n	{\n		SrcColour = mix(SrcColour, gm_FogColour, clamp(fogval, 0.0, 1.0)); \n	}\n}\n\n#define _YY_GLSLES_ 1\n//\n// Simple 'CRT' Shader with:\n// - horisontal blur\n// - scanlines\n// - noise\n//\n// by Baku\n//\n \nvarying vec2 v_vTexcoord;\nvarying vec4 v_vColour;\n \nuniform float texel_x;                  // x texel\nuniform float texel_y;                  // y texel\nuniform float scanline_strength;        // 0 - 1, lower is stronger\nuniform float scanline_size;            // how tall each scanline is\nuniform float scanline_dark_size;       // ratio of the scanline size that's dark, 0 - 1\nuniform float scanline_brightness_comp; // makes the non-darkened part brighter to 'compensate' for the darkness, bool (breaks at extreme scanline strengths...)\nuniform float noise_seed;               // give it some random number\nuniform float noise_strength;           // higher = stronger (>0 = white noise, <0 = black noise)\nuniform float blur_strength;            // ideally 0 - 1, lower = more blurry (>1 = 'sharpen', <0 = some sorta trippy 'blurry sharpen')\nuniform float blur_dis;                 // ideally 0 - 1\n \nvoid main()\n{\n    // Blur\n    vec2 left_coord = vec2(v_vTexcoord.x - (texel_x * blur_dis), v_vTexcoord.y);\n    if (left_coord.x <= (texel_x * blur_dis)) {\n        left_coord = v_vTexcoord;\n    }\n    vec4 left_col = texture2D(gm_BaseTexture, left_coord) * ((1.0 - blur_strength) / 2.0);\n    vec2 right_coord = vec2(v_vTexcoord.x + (texel_x * blur_dis), v_vTexcoord.y);\n    if (right_coord.x >= 1.0 - (texel_x * blur_dis)) {\n        right_coord = v_vTexcoord;\n    }\n    vec4 right_col = texture2D(gm_BaseTexture, right_coord) * ((1.0 - blur_strength) / 2.0);\n    vec4 current_col = texture2D(gm_BaseTexture, v_vTexcoord);\n    vec4 blur_col = (current_col * blur_strength) + left_col + right_col;\n   \n    // CRT Scanlines\n    float scanline_size_corrected = scanline_size;\n    float value_y = floor((mod(v_vTexcoord.y, texel_y * scanline_size_corrected) * 1.0 / (texel_y * scanline_size_corrected)) + scanline_dark_size);\n    if (value_y != 0.0) {\n        // Darkened by scanline\n        value_y = scanline_strength;\n    } else {\n        // Make brighter\n        if (scanline_brightness_comp == 1.0) {\n            value_y = 1.0 / scanline_strength;\n        } else {\n            value_y = 1.0;\n        }\n    }\n    vec4 scanline = vec4(value_y, value_y, value_y, 1.0);\n   \n    // Noise\n    vec2 rounded = v_vTexcoord.xy;\n    rounded.x = floor(v_vTexcoord.x / texel_x) * texel_x;\n    rounded.y = floor(v_vTexcoord.y / texel_y) * texel_y;\n    float value_noise = fract(sin(dot(rounded.xy, vec2(12.9898, 78.233))) * noise_seed) * noise_strength;\n    vec4 noise = vec4(value_noise, value_noise, value_noise, 1.0);\n   \n    // Final colour\n    gl_FragColor = (v_vColour * blur_col * scanline) + noise;\n}\n",
